import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Navbar from './components/Navbar';
import Footer from './components/Footer';
import LoadingScreen from './components/LoadingScreen';
import SchoolInfo from './components/SchoolInfo';
import ClassRoutine from './components/ClassRoutine';
import SchoolLocation from './components/SchoolLocation';
import CustomCursor from './components/CustomCursor'; // Import Custom Cursor
import Gallery from './components/Gallery'; // Import Gallery
import ChatRoom from './components/ChatRoom'; // Import ChatRoom

const App = () => {
  return (
    <Router>
      <div className="App">
        <CustomCursor /> {/* Include Custom Cursor */}
        <LoadingScreen />
        <Navbar />
        <Routes>
          <Route
            path="/"
            element={
              <>
                <SchoolInfo />
                <ClassRoutine />
                <SchoolLocation />
              </>
            }
          />
          <Route path="/gallery" element={<Gallery />} />
          <Route path="/chat" element={<ChatRoom />} /> {/* New route for ChatRoom */}
        </Routes>
        <Footer />
      </div>
    </Router>
  );
};

export default App;
